export function headerContentDataSuccess(headerAC) {
    return {
        type: "HEADER_CONTENT_DATA_SUCCESS",
        headerAC
    }
}

export function headerContentData(url) {
    return (dispatch) => {
        fetch(url)
            .then(
                response => {
                    if (!response.ok) {
                        throw new Error(response.statusText)
                    }
                    return response
                })
            .then(response => response.json())
            .then(headerAC => dispatch(headerContentDataSuccess(headerAC)))
    }
}
